Mongoose: populate an array based on ids<p>I have a small CRUD application, where user is authenticated and able to create/add to favorites some recipes. I have been stuck on the adding to favorites for some time now. </p>

<p>This is my user schema:</p>

<pre><code>const UserSchema = Schema({
    googleId: String,
    name: String,
    favorites: [{ type: mongoose.Schema.Types.ObjectId, ref: 'Recipe' }],
});
</code></pre>

<p>And this is my recipe schema:</p>

<pre><code>const RecipeSchema = new Schema({
    title: {
        type: String,
        required: [true, 'Title of the recipe is required'],
    },
    category: {
        type: Array,
        required: [true, 'Category is required'],
    },
    description: {
        type: String,
        required: [true, 'Description is required'],
    },
    imgUrl: {
        type: String,
        required: [true, 'Image is required'],
    },
    ingredients: {
        type: Array,
        required: [true, 'Ingredients are required'],
    },
    timeOfPreparation: {
        type: String,
        required: true,
    },
    preparation: {
        type: String,
        required: true,
    },
    sourceName: {
        type: String,
        required: true,
    },
    sourceUrl: {
        type: String,
        required: true,
    },
    fans: [{ type: mongoose.Schema.Types.ObjectId, ref: 'User' }],
});
</code></pre>

<p>Both are exported in this manner from their respective files:</p>

<pre><code>    const Recipe = mongoose.model('recipe', RecipeSchema);
    const User = mongoose.model('user', UserSchema);

    module.exports = Recipe;   
    module.exports = User;
</code></pre>

<p>The user is authenticated with passport and this part works just fine. Then, when a user clicks favorite button on the front end (or I send a request in postman) to endpoint (PUT) '/:userId/favorites', the controller then goes to the array of favorites and pushes a new id:</p>

<pre><code>exports.add_to_favorite = (req, res) =&gt; {
        const { recipeId } = req.body;

            User.findByIdAndUpdate(
                {
                    _id: req.params.userId,
                },
                { $addToSet: { favorites: recipeId } }
            ).then(() =&gt; {
                User.findById({
                    _id: req.params.userId,
                }).then(() =&gt; res.send(res.status));
            });
        };
</code></pre>

<p>However, as I would like to show favorites on frontend, not only their ids, I found a way to connect those two collections: populate method in mongoose. This however has not worked as anticipated and I get undefined:</p>

<pre><code>exports.get_favorites = (req, res) =&gt; {
    User.findById({
        _id: req.params.userId,
    })
        .populate('favorites')
        .exec((err, recipe) =&gt; {
            console.log(recipe);
            res.send(recipe);
        });
};
</code></pre>

<p>How should I populate the favorites array with actual objects that contain data needed for me to render in then on my front end part of application?</p>

