Send mongodb aggregation criteria through url query string<p>what I'm trying to achieve is build a MongoDB aggregation stage on the client side then send it through an URL query string to the web API to get the results based on those criteria.</p>

<p>I'm debbugging with postman with this url: </p>

<pre><code>http://.../monsters/aggregate?pipes={"$match":{"name":"foo"}, "$max": 2}
</code></pre>

<p>In the controller I have:</p>

<pre><code>    [HttpGet("aggregate")]
    public async Task&lt;IActionResult&gt; GetByAggregate([FromQuery(Name = "pipes")]string pipes)
    {
        if (!string.IsNullOrEmpty(pipes))
        {
            BsonDocument d = BsonDocument.Parse(pipes);

            var p = PipelineDefinition&lt;T, T&gt;.Create(d);

            IAsyncCursor&lt;T&gt; result = await _monsterService.AggregateAsync(p);

            return Ok(result.ToListAsync());
        }

        return NotFound();
    }
</code></pre>

<p>This is not working, the error message :</p>

<blockquote>
  <p>MongoCommandException: Command aggregate failed: A pipeline stage specification object must contain exactly one field..</p>
</blockquote>

<p>But with this url I get what I want:</p>

<pre><code>http://.../monsters/aggregate?pipes={"$match":{"name":"foo"}}
</code></pre>

<p>How to parse mongodb pipeline to a correct json format for the url query string then deserialized to a mongodb pipeline stages on the api side ?</p>

<p>Is there a better way to do it, is this logic possible?</p>

<p>I tried some urls form <a href="https://restdb.io/docs/querying-with-the-api" rel="nofollow noreferrer">thirdparty</a> but can't make it work...</p>

<p>Any help will much be appreciated!</p>

