Dates and times are wrong in MongoDB<p>I'm building a blog site that logs the time and date when an entry is posted and stored in MongoDB. When I run it on my local machine, the date and time are correct. But when I hosted it on Heroku, the date shows it is 8 hours ahead of my time. Why is this and how can I fix it? Here's the link to the app:</p>

<p><a href="https://protected-basin-36050.herokuapp.com/" rel="nofollow noreferrer">Blog App</a></p>

<p>Also here is the code that is responsible for posting an entry and logging the date and time:</p>

<pre><code>app.post("/compose", (req, res) =&gt; {
  const postTitle = req.body.postTitle;
  const postBody = req.body.postBody;

  let date = new Date();
  let postDate = date.toLocaleString('en-US');

  const post = new Post({
    date: postDate,
    title: postTitle,
    content: postBody
  });

  post.save(err =&gt; {
    if (!err) {
      res.redirect("/");
    }
  });
});
</code></pre>

