How to improve mongoDb query performance?<p>I have a collection named <code>Codes</code>. This is how the <code>Schema</code> is defined:</p>

<pre><code>import mongoose from 'mongoose'
import autoIncrement from 'mongoose-auto-increment';

const Schema = mongoose.Schema;
const CodesSchema = mongoose.Schema(
  {
    configId: { type: Number },
    campaignId: { type: Number },
    permissions: {
      all: { type: Boolean, default: false },
      users: { type: [Number], default: [] }
    }
)

autoIncrement.initialize(mongoose.connection);
CodesSchema.plugin(autoIncrement.plugin, { model: 'Codes', field: 'campaignId' });
export default mongoose.model('Codes', CodesSchema)
</code></pre>

<p>There is one query that looks like this:</p>

<pre><code>const query = {
  $and:[
    {$or: [
      {'permissions.all': true},
      {'permissions.users': 12}
    ]},
    {configId: 3}
  ]
};

Codes.find(query, (err, res) =&gt; {
  // do something with the result
})
</code></pre>

<p>This works fine, but if there is a huge number of documents in the database then this query is really slow.</p>

<p>Is there anything I can do to improve the performance of this specific query? I'm thinking that <code>createIndex</code> would help, but I'm not sure if that can be applied since there are <code>$and</code> and <code>$or</code> conditions.</p>

<p><strong>UPDATE</strong></p>

<p>I've added indexes this way:</p>

<pre><code>CodesSchema.index({configId: 1, 'permissions.all': 1, 'permissions.users': 1});
</code></pre>

<p>But running the query with <code>.explain('executionStats')</code> option returns:</p>

<pre><code>{
    "executionSuccess" : true,
    "nReturned" : 6,
    "executionTimeMillis" : 0,
    "totalKeysExamined" : 10,
    "totalDocsExamined" : 10,
}
</code></pre>

<p>Which doesn't seems right because the number of docs examined is greater than the number of docs returned.</p>

